parameters:    aliznet_wcs_export.processor.product.class                  :   Aliznet\WCSBundle\Processor\ProductProcessor    aliznet_wcs.processor.item.class                            :   Aliznet\WCSBundle\Processor\ItemProcessor    aliznet_wcs_export.processor.wcs_productprice_export.class  :   Aliznet\WCSBundle\Processor\ProductPriceProcessor    aliznet_wcs.processor.items_prices.class                    :   Aliznet\WCSBundle\Processor\ItemPriceProcessor    aliznet_wcs.processor.attribute.class                       :   Aliznet\WCSBundle\Processor\AttributeProcessor    aliznet_wcs.processor.attribute_values_language.class       :   Aliznet\WCSBundle\Processor\AttributeValuesLanguageProcessor    aliznet_wcs.processor.attribute_values.class                :   Aliznet\WCSBundle\Processor\AttributeValuesProcessor    aliznet_wcs.processor.category.class                        :   Aliznet\WCSBundle\Processor\CategoryProcessor    aliznet_wcs.processor.category.multiLang.class              :   Aliznet\WCSBundle\Processor\CategoryMultiLangProcessor    aliznet_wcs.entity.category.class                           :   Aliznet\WCSBundle\Entity\Category    aliznet_wcs.processor.def_item_attribute_value.class        :   Aliznet\WCSBundle\Processor\ProductAttributeDefValueProcessor    aliznet_wcs.processor.desc_item_attribute_value.class       :   Aliznet\WCSBundle\Processor\ProductAttributeDescValueProcessor    aliznet_wcs.processor.def_item_attribute_trans_value.class  :   Aliznet\WCSBundle\Processor\ProductAttributeDefTransValueProcessor    aliznet_wcs.processor.desc_item_attribute_trans_value.class :   Aliznet\WCSBundle\Processor\ProductAttributeDescTransValueProcessor        services:   ## products and items    aliznet_wcs_export.processor.product:        class: %aliznet_wcs_export.processor.product.class%        arguments:            - '@doctrine.orm.default_entity_manager'            - '@pim_catalog.manager.channel'            - %pim_catalog.entity.locale.class%    aliznet_wcs.processor.item:        class: %aliznet_wcs.processor.item.class%        arguments:            - '@doctrine.orm.default_entity_manager'            - '@pim_catalog.manager.channel'            - ['pim_catalog_file', 'pim_catalog_image']            - %pim_catalog.entity.locale.class%            - '@pim_catalog.builder.product'    aliznet_wcs.processor.wcs_productprice_export:        class: %aliznet_wcs_export.processor.wcs_productprice_export.class%        arguments:            - '@doctrine.orm.default_entity_manager'            - '@pim_catalog.manager.channel'            - %pim_catalog.entity.locale.class%    aliznet_wcs.processor.items_prices:        class: %aliznet_wcs.processor.items_prices.class%        arguments:            - '@doctrine.orm.default_entity_manager'            - '@pim_catalog.manager.channel'            - ['pim_catalog_file', 'pim_catalog_image']            - %pim_catalog.entity.locale.class%            - '@pim_catalog.builder.product'            ## attributs    aliznet_wcs.processor.attribute:        class: %aliznet_wcs.processor.attribute.class%        arguments:            - '@pim_catalog.manager.channel'            - ['pim_catalog_file', 'pim_catalog_image']            - '@pim_catalog.builder.product'    aliznet_wcs.processor.attribute_values_language:        class: %aliznet_wcs.processor.attribute_values_language.class%        arguments:            - '@pim_catalog.manager.channel'            - ['pim_catalog_file', 'pim_catalog_image']            - '@pim_catalog.builder.product'    aliznet_wcs.processor.attribute_values:        class: %aliznet_wcs.processor.attribute_values.class%        arguments:            - '@pim_catalog.manager.channel'            - ['pim_catalog_file', 'pim_catalog_image']            - '@pim_catalog.builder.product'               ## categories    aliznet_wcs.processor.category:        class: %aliznet_wcs.processor.category.class%        parent: pim_base_connector.processor.transformer        arguments:            - %pim_catalog.entity.category.class%            - '@pim_transform.cache.doctrine_cache'    aliznet_wcs.processor.category.multiLang:        class: %aliznet_wcs.processor.category.multiLang.class%        arguments:            - '@pim_base_connector.validator.import'            - '@translator'            - '@pim_transform.transformer.registry'            - '@pim_catalog.doctrine.smart_manager_registry'            - '@pim_catalog.helper.locale'            - %pim_catalog.entity.locale.class%    ## Item attributs    aliznet_wcs.processor.def_item_attribute_value:        class: %aliznet_wcs.processor.def_item_attribute_value.class%        arguments:            - '@pim_catalog.manager.channel'            - ['pim_catalog_file', 'pim_catalog_image']            - '@pim_catalog.builder.product'    aliznet_wcs.processor.desc_item_attribute_value:        class: %aliznet_wcs.processor.desc_item_attribute_value.class%        arguments:            - '@pim_catalog.manager.channel'            - ['pim_catalog_file', 'pim_catalog_image']            - '@pim_catalog.builder.product'    aliznet_wcs.processor.def_item_attribute_trans_value:        class: %aliznet_wcs.processor.def_item_attribute_trans_value.class%        arguments:            - '@pim_catalog.manager.channel'            - '@pim_catalog.builder.product'            - '@pim_catalog.doctrine.smart_manager_registry'            - '@pim_catalog.helper.locale'            - ['pim_catalog_file', 'pim_catalog_image']            - %pim_catalog.entity.locale.class%    aliznet_wcs.processor.desc_item_attribute_trans_value:        class: %aliznet_wcs.processor.desc_item_attribute_trans_value.class%        arguments:            - '@pim_catalog.manager.channel'            - '@pim_catalog.builder.product'            - '@pim_catalog.doctrine.smart_manager_registry'            - '@pim_catalog.helper.locale'            - ['pim_catalog_file', 'pim_catalog_image']            - %pim_catalog.entity.locale.class%                